	// 比較牌型大小
	public function PaiCompare($sPair1, $sPair2)
	{
		$aSet1 = $aSet2 = array();

		if(isset($this->aPaiSet[$sPair1]) && !isset($this->aPaiSet[$sPair2]))
		{
			// 1有牌型 -1沒 => 贏
			return 1;
		}
		else if(!isset($this->aPaiSet[$sPair1]) && isset($this->aPaiSet[$sPair2]))
		{
			// 1沒牌型 -1有 => 輸
			return -1;
		}
		else if(isset($this->aPaiSet[$sPair1]) && isset($this->aPaiSet[$sPair2]))
		{
			if($this->aPaiSet[$sPair1]['nValue'] < $this->aPaiSet[$sPair2]['nValue'])
			{
				// 1 牌型大 => 贏
				return 1;
			}
			else if($this->aPaiSet[$sPair1]['nValue'] > $this->aPaiSet[$sPair2]['nValue'])
			{
				// 1牌型小 => 輸
				return -1;
			}
			else
			{
				// 牌型一樣 => 和
				return 0;
			}
		}
		else
		{
			return 0;
		}
	}

	// 計算組合(變形) $nCount 取4個一組
	public function CalPermutations($nCount)
	{
		$aData = array();

		for($nI = 0; $nI < $nCount; $nI++)
		{
			for($nJ = $nI+1; $nJ < $nCount; $nJ++)
			{
				for($nK = $nJ+1; $nK < $nCount; $nK++)
				{
					for($nL = $nK+1; $nL < $nCount; $nL++)
					{
						$aData[][] = array($nI,$nJ,$nK,$nL);
					}
				}
			}
		}

		foreach($aData as $LPsKey => $LPaCompareData)
		{
			$aCompare = $aData[$LPsKey][0];

			for($nI = 0; $nI < count($aData); $nI++)
			{
				for($nJ = 0; $nJ < count($aData[$nI]); $nJ++)
				{
					for($nK = 0; $nK < count($aData[$nI][$nJ]); $nK++)
					{
						foreach($aCompare as $LPsCom)
						{
							if($LPsCom == $aData[$nI][$nJ][$nK])
							{
								continue 4;
							}
						}
					}
				}

				$aData[$nI][] = $aCompare;
			}
		}

		return $aData;
	}

	// 過濾重複
	public function FilterSame($aData)
	{
		$aReturn = array();

		foreach($aData as $LPnIndex1 => $LPaData1)
		{
			foreach($LPaData1 as $LPnIndex2 => $LPaData2)
			{
				$aData2[$LPnIndex1][$LPaData2[0].','.$LPaData2[1].','.$LPaData2[2].','.$LPaData2[3]] = 1;
			}
		}

		for($nI = 0; $nI < count($aData2); $nI++)
		{
			for($nJ = $nI+1; $nJ < count($aData2); $nJ++)
			{
				if($this->IsSame($aData2[$nI], $aData2[$nJ]))
				{
					continue 2;
				}
			}

			// $aData3[] = $aData2[$nI];
			
			$aTmp = array();

			foreach($aData2[$nI] as $LPsIndex => $LPaData2)
			{
				$aIndexTmp = explode(',', $LPsIndex);

				$aTmp2 = array();
				foreach($aIndexTmp as $LPaIndexTmp)
				{
					$aTmp2[] = $LPaIndexTmp;
				}

				$aTmp[] = $aTmp2;
			}
			// echo '<pre>'; print_r($aTmp); echo '</pre>';
			$aReturn[] = $aTmp;
		}

		return $aReturn;
	}

	// 判斷相同
	private function IsSame($aData1, $aData2)
	{
		$aSame = array();
		$nI = 0;

		foreach($aData1 as $LPsIndex => $LPaData1)
		{
			$aSame[$nI] = isset($aData2[$LPsIndex]) ? true : false;
			$nI++;
		}

		if($aSame[0] && $aSame[1] && $aSame[2] && $aSame[3])
		{
			return true;
		}
		return false;
	}

	// 牌型格式化
	public function TypeFormat($aPair)
	{
		$sSet1 = $sSet2 = '';

		$nValue = 100;
		$aIndex = array();
		for($nI = 0; $nI < count($aPair); $nI++)
		{
			for($nJ = $nI+1; $nJ < count($aPair); $nJ++)
			{
				if(isset($this->aPaiSet[$aPair[$nI].$aPair[$nJ]]['nValue']) && $this->aPaiSet[$aPair[$nI].$aPair[$nJ]]['nValue'] < $nValue)
				{
					$aIndex = array(
						$nI	=> 1,
						$nJ	=> 1,
					);
					$nValue = $this->aPaiSet[$aPair[$nI].$aPair[$nJ]]['nValue'];
				}
			}
		}

		foreach($aPair as $LPnIndex => $LPsPai)
		{
			isset($aIndex[$LPnIndex]) ? $sSet1 .= $LPsPai : $sSet2 .= $LPsPai;
		}

		return array($sSet1, $sSet2);
	}

	// 牌組比大小
	public function AllCompare($aAllPair)
	{
		$aReturn = array();

		for($nI = 0; $nI < count($aAllPair); $nI++)
		{
			for($nJ = $nI+1; $nJ < count($aAllPair); $nJ++)
			{
				if(!isset($aReturn[$aAllPair[$nI][0].$aAllPair[$nI][1]]))
				{
					$aReturn[$aAllPair[$nI][0].$aAllPair[$nI][1]] = array(
						'nWin'	=> 0,
						'nLose'	=> 0,
						'nHo'		=> 0,
					);
				}

				if(!isset($aReturn[$aAllPair[$nJ][0].$aAllPair[$nJ][1]]))
				{
					$aReturn[$aAllPair[$nJ][0].$aAllPair[$nJ][1]] = array(
						'nWin'	=> 0,
						'nLose'	=> 0,
						'nHo'		=> 0,
					);
				}

				if(($this->PaiCompare($aAllPair[$nI][0], $aAllPair[$nJ][0]) + $this->PaiCompare($aAllPair[$nI][1], $aAllPair[$nJ][1])) > 0)
				{
					$aReturn[$aAllPair[$nI][0].$aAllPair[$nI][1]]['nWin']++;
					$aReturn[$aAllPair[$nJ][0].$aAllPair[$nJ][1]]['nLose']++;
				}
				else if(($this->PaiCompare($aAllPair[$nI][0], $aAllPair[$nJ][0]) + $this->PaiCompare($aAllPair[$nI][1], $aAllPair[$nJ][1])) < 0)
				{
					$aReturn[$aAllPair[$nI][0].$aAllPair[$nI][1]]['nLose']++;
