	// 依陣列指定欄位排序
	public function SortArrByColumn($aArray, $sColumn, $bDesc = true)
	{
		$aReturn = array();

		$aTmp = array();
		foreach($aArray as $LPsKey => $LPaValue)
		{
			$aTmp[] = $LPsKey;
		}

		if($bDesc)
		{
			for($nI = 0; $nI < count($aArray); $nI++)
			{
				for($nJ = 0; $nJ < count($aArray); $nJ++)
				{
					if($aArray[$aTmp[$nI]][$sColumn] > $aArray[$aTmp[$nJ]][$sColumn])
					{
						$sTmp = $aTmp[$nI];
						$aTmp[$nI] = $aTmp[$nJ];
						$aTmp[$nJ] = $sTmp;
					}
				}
			}
		}
		else
		{
			for($nI = 0; $nI < count($aArray); $nI++)
			{
				for($nJ = 0; $nJ < count($aArray); $nJ++)
				{
					if($aArray[$aTmp[$nI]][$sColumn] < $aArray[$aTmp[$nJ]][$sColumn])
					{
						$sTmp = $aTmp[$nI];
						$aTmp[$nI] = $aTmp[$nJ];
						$aTmp[$nJ] = $sTmp;
					}
				}
			}
		}

		foreach($aTmp as $LPsKey => $LPsIndex)
		{
			$aReturn[$LPsIndex] = $aArray[$LPsIndex];
		}

		return $aReturn;
	}

